import React from "react";
import { BrowserRouter as Router, Route } from "react-router";

//pages and components
import Home from "./Pages/Home";

const App = () => {
  return (
    <Router>
      <div>
        <Route exact path="/" component={Home} />
      </div>
    </Router>
  );
};
export default App;
